import turtle 

def Bezier_1(p1, p2, t):  # 一阶贝塞尔函数
    return p1 * (1 - t) + p2 * t


def Bezier_3(x1, y1, x2, y2, x3, y3, x4, y4):  # 三阶贝塞尔函数
    x1 = -Width / 2 + x1# 坐标变换
    y1 = Height / 2 - y1
    x2 = -Width / 2 + x2
    y2 = Height / 2 - y2
    x3 = -Width / 2 + x3
    y3 = Height / 2 - y3
    x4 = -Width / 2 + x4
    y4 = Height / 2 - y4
    turtle.penup()
    turtle.goto(x1, y1)
    turtle.pendown()
    for t in range(0, WriteStep + 1):
        x = Bezier_1(Bezier_1(Bezier_1(x1, x2, t / WriteStep), Bezier_1(x2, x3, t / WriteStep), t / WriteStep),
                   Bezier_1(Bezier_1(x2, x3, t / WriteStep), Bezier_1(x3, x4, t / WriteStep), t / WriteStep), t / WriteStep)
        y = Bezier_1(Bezier_1(Bezier_1(y1, y2, t / WriteStep), Bezier_1(y2, y3, t / WriteStep), t / WriteStep),
                   Bezier_1(Bezier_1(y2, y3, t / WriteStep), Bezier_1(y3, y4, t / WriteStep), t / WriteStep), t / WriteStep)
        turtle.goto(x, y)
    turtle.penup()


def Moveto(x, y):  # 移动到坐标（x，y）的点
    turtle.penup()
    turtle.goto(-Width / 2 + x, Height / 2 - y)


def Moveto_r(dx, dy):# 移动到相对坐标（dx,dy）的点
    turtle.penup()
    turtle.goto(turtle.xcor() + dx, turtle.ycor() - dy)


def Lineto_r(dx, dy):  # 连接当前点和相对坐标（dx，dy）的点
    turtle.pendown()
    turtle.goto(turtle.xcor() + dx, turtle.ycor() - dy)
    turtle.penup()


def Lineto(x, y):  # 连接当前点和坐标（x，y）的点
    turtle.pendown()
    turtle.goto(-Width / 2 + x, Height / 2 - y)
    turtle.penup()


def Curveto(x1, y1, x2, y2, x, y):  # 三阶贝塞尔曲线到坐标（x，y）
    X_now = turtle.xcor() + Width / 2
    Y_now = Height / 2 - turtle.ycor()
    Bezier_3(X_now, Y_now, x1, y1, x2, y2, x, y)
    global Xh
    global Yh
    Xh = x - x2
    Yh = y - y2


def Curveto_r(x1, y1, x2, y2, dx, dy):  # 三阶贝塞尔曲线到相对坐标（dx，dy）
    X_now = turtle.xcor() + Width / 2
    Y_now = Height / 2 - turtle.ycor()
    Bezier_3(X_now, Y_now, X_now + x1, Y_now + y1,
             X_now + x2, Y_now + y2, X_now + dx, Y_now + dy)
    global Xh
    global Yh
    Xh = dx - x2
    Yh = dy - y2


